import { useLocation } from "react-router-dom";



export function Server(props){
    const location = useLocation();
    const pathSegments = location.pathname.split('/'); // 현재 경로를 분할
    return(
        <div class="ClickCont">
            <Link to={`/channel/${pathSegments[props.server]}`}>{props.name}</Link>
        </div>
    )
    function handleClick(){
        alert(props.server)
    }
    return(
        <li onClick={handleClick} className="serverpop">
                        <img src="https://cdn-icons-png.flaticon.com/512/6522/6522516.png" width={85}height={85} ></img>
        </li>    
        
    )
}
